import React from "react";

import {ItensMenu} from "./ItensMenu";

const NavigationMenu = () => {
    return (
        <>
            <nav>
                <ul>
                    {
                        ItensMenu.map(item => {
                            return (
                                <li>
                                    <a href={item.link}>
                                        {item.name}
                                    </a>
                                </li>
                            )
                        })
                    }
                </ul>
            </nav>
        </>
    )
}

export default NavigationMenu;
